import '../index.css';
import Header from './Header';
import Main from './Main';
import Footer from './Footer';

function App() {

// function handleEditAvatarClick() {
// document.querySelector('.profile__edit-avatar-btn').classList.add('popup_opened');
// console.log('hallo');
// }

// function handleEditProfileClick() {
//     document.querySelector('.profile__edit-btn').classList.add('popup_opened');  
// }

// function handleAddPlaceClick() {
//     document.querySelector('.profile__add-btn').classList.add('popup_opened');


    return (
        <div className="App">
            <Header />
            <Main 
            onEditAvatar={() => document.querySelector('.profile__edit-avatar-btn').classList.add('popup_opened')}
            // onEditProfile={handleEditProfileClick}
            // onAddPlace={handleAddPlaceClick}
            />
            <Footer />

            <div className="popup popup_type_edit-profile">
                <div className="popup__container">
                    <button type="button" className="popup__closed-btn"></button>
                    <h3 className="popup__title">Редактировать профиль</h3>
                    <form action="/" className="popup__form popup__form_profile" name="edit-form" noValidate>
                        <fieldset className="popup__form-items">
                            <input className="popup__input popup__input_type_user-name" type="text" name="name" id="username-input"
                                value="" placeholder="Имя" minLength="2" maxLength="40" required="required" />
                            <span className="popup__input-error username-input-error"></span>
                            <input className="popup__input popup__input_type_profession" type="text" name="about"
                                id="profession-input" value="" placeholder="Профессия" minLength="2" maxLength="200"
                                required="required" />
                            <span className="popup__input-error profession-input-error"></span>
                        </fieldset>
                        <button type="submit" className="popup__save-btn">Сохранить</button>
                    </form>
                </div>
            </div>
            <div className="popup popup_type_add-new-card">
                <div className="popup__container">
                    <button type="button" className="popup__closed-btn"></button>
                    <h3 className="popup__title">Новое место</h3>
                    <form action="/" className="popup__form popup__form_new-card" name="cards-form" noValidate>
                        <fieldset className="popup__form-items">
                            <input className="popup__input popup__input_type_image-name" type="text" name="name"
                                id="image-name-input" value="" placeholder="Название" minLength="2" maxLength="30"
                                required="required" />
                            <span className="popup__input-error image-name-input-error"></span>
                            <input className="popup__input popup__input_type_image-link" type="url" name="link"
                                id="image-link-input" value="" placeholder="Ссылка на картинку" required="required" />
                            <span className="popup__input-error image-link-input-error"></span>
                        </fieldset>
                        <button type="submit" className="popup__save-btn popup__create-btn">Создать</button>
                    </form>
                </div>
            </div>
            <div className="popup popup_type_image">
                <figure className="popup__figure-image">
                    <img className="popup__preview-image" src="#" alt="" />
                    <button type="button" className="popup__closed-btn"></button>
                    <figcaption className="popup__title-image"></figcaption>
                </figure>
            </div>
            <div className="popup popup_type_confirm">
                <div className="popup__container">
                    <button type="button" className="popup__closed-btn"></button>
                    <form action="/" className="popup__form popup__form_confirm" name="confirm-form" noValidate>
                        <h2 className="popup__title">Вы уверены?</h2>
                        <button type="submit" className="popup__save-btn">Да</button>
                    </form>
                </div>
            </div>
            <div className="popup popup_type_update-avatar">
                <div className="popup__container">
                    <button type="button" className="popup__closed-btn"></button>
                    <h3 className="popup__title">Обновить аватар</h3>
                    <form action="/" className="popup__form popup__form_update-avatar" name="update-avatar-form" noValidate>
                        <fieldset className="popup__form-items">
                            <input className="popup__input popup__input_type_avatar-link" type="url" name="avatar"
                                id="avatar-link-input" value="" placeholder="Ссылка на картинку" required="required" />
                            <span className="popup__input-error avatar-link-input-error"></span>
                        </fieldset>
                        <button type="submit" className="popup__save-btn">Сохранить</button>
                    </form>
                </div>
            </div>
            <template className="elements__card-template">
                <article className="elements__element">
                    <button type="button" className="elements__delete-btn"></button>
                    <img className="elements__image" src="#" alt="" />
                    <div className="elements__container">
                        <h2 className="elements__title"></h2>
                        <div className="elements__container-likes">
                            <button type="button" className="elements__like-btn"></button>
                            <p className="elements__like-count"></p>
                        </div>
                    </div>
                </article>
            </template>
        </div>
    );
}

export default App;
